                            <AppText style={styles.catTextT}>
                                <AppTextBold style={styles.shortBold}>“События”</AppTextBold> - это дополнительная роль. Она позволяет выкладывать на страницах портала информацию о проводимых мероприятиях, выставках и фестивалях по тематике ресурса. Включение роли требует символической оплаты.
                            </AppText>
